import React from "react";
import "../pages/contacts.css";
const Contact = () => {
  return (
    <div className="contacts-container">
      <img
        className="cnt-img"
        src="https://www.containex.com/-/m/resize?quality=80&image=https%3A%2F%2Fwww.containex.com%2F-%2Fm%2Fpicturepark%2Fctx%2Fstart%2Fcontent%2Fimage-cards%2Fbuerocontainer%2Fimage%2F8d9dcc67181ef2c.jpg%3Fh%3D1933%26w%3D2560%26la%3Den%26rev%3D8e0bc498f2356cdb1327ef9ea80bcaac"
        alt="container"
      />
      <div>
        <h1>Contact Us</h1>
        <p className="price">Fb:Storage_Center</p>
        <p className="price">Twitter:@Storage_Center</p>
        <p>Phone Number: 0115868686</p>
        <p>
          <button>Follow us Now</button>
        </p>
      </div>
    </div>
  );
};

export default Contact;
